import styles from "./Headercss.module.css";



const Body = () => {
  return (
    <>
    <div>
      <a href="/"><h1 className={styles.bodyofferbar}></h1></a>
    </div>
    <div>
      <a href="/"><h1 className={styles.bodyofferbar}></h1></a>
    </div>
    <div>
      <a href="/"><h1 className={styles.bodyofferbar}></h1></a>
    </div>
    <div>
      <a href="/"><h1 className={styles.bodyofferbar}>IN PROGRESS</h1></a>
    </div>
    <div>
      <a href="/"><h1 className={styles.bodyofferbar}>IN PROGRESS</h1></a>
    </div>
    </>
  );
};

export default Body;
